import React from 'react'
import TodoItem from './TodoItem'

export default function todos(props) {
    return (
        <>
            <div className="container">
                <h3 className="text-center">Todos List</h3>
                {props.todos.map((todo) => {
                    return <TodoItem todo={todo}/>
                })}

            </div>
        </>
    )
}
